import React from 'react';


function App() {
  return (
    <div className="App">
      <label>Customer Name</label>
        <input type="text" name="name" list="names"/>
          <datalist id="names">
            <option value="Magenta"/>
            <option value="Purple"/>
            <option value="Ultraviolet"/>
          </datalist>
    </div>
  );
}

export default App;
